import axios from "axios";
import React, { useCallback, useEffect, useState } from "react";
import { useLocation, useNavigate, useParams } from "react-router-dom";
import {
  getAttemptById,
  logEvent,
  flushPendingEvents,
  getQuestions,
  getAttemptAnswers,
  saveAnswers,
  submitTest,
} from "../services/api";
import TimerComponent from "./TimerComponent";
import { EventLoggerProvider } from "../context/EventLoggerContext";
import useProctoring from "../hooks/useProctoring";
import "./TestPageComponent.css";

const TestPageComponent = () => {
  const { attemptId } = useParams();
  const [attemptDetails, setAttemptDetails] = useState(null);
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [questions, setQuestions] = useState([]);
  const [answers, setAnswers] = useState({});
  const [saving, setSaving] = useState(false);

  const location = useLocation();
  const navigate = useNavigate();

  const persistAnswers = useCallback(
    async (answersToSave) => {
      if (!attemptId || isSubmitted) return;
      const payload = Object.entries(answersToSave).map(([questionId, value]) => ({
        questionId,
        value: value ?? "",
      }));
      if (payload.length === 0) return;
      try {
        setSaving(true);
        await saveAnswers(attemptId, payload);
      } catch (err) {
        console.error("Failed to save answers:", err);
      } finally {
        setSaving(false);
      }
    },
    [attemptId, isSubmitted]
  );

  const handleSubmit = async () => {
    if (isSubmitted) return;

    try {
      setIsSubmitted(true);
      await persistAnswers(answers);
      logEvent({
        attemptId,
        eventType: "TEST_SUBMITTED",
        questionId: null,
        metadata: getBrowserMetadata(),
      });
      await submitTest(attemptId);
      navigate(`/result/${attemptId}`, { replace: true });
    } catch (error) {
      console.error("Error submitting test:", error);
      setIsSubmitted(false);
    }
  };

  const handleAnswerChange = (questionId, value) => {
    setAnswers((prev) => ({ ...prev, [questionId]: value }));
  };

  const handleAnswerBlur = () => {
    persistAnswers(answers);
  };

  useEffect(() => {
    const enterFullscreen = async () => {
      try {
        await document.documentElement.requestFullscreen();
      } catch (err) {
        console.error("Fullscreen failed:", err);
      }
    };

    enterFullscreen();
  }, []);

  // ðŸ”¥ Auto submit after 3 violations
  const handleViolationLimit = async () => {
    // await submitTest(attemptId); // your submit API
    // navigate(`/result/${attemptId}`, { replace: true });
    console.log("Violation limit reached. Auto-submitting test...");
  };

  // ðŸ”¥ Activate proctoring
  useProctoring({
    attemptId,
    onViolationLimitReached: handleViolationLimit,
  });

  const getBrowserMetadata = () => ({
    userAgent: navigator.userAgent,
    platform: navigator.platform,
    language: navigator.language,
    screenResolution: `${window.screen.width}x${window.screen.height}`,
    onlineStatus: navigator.onLine,
  });

  useEffect(() => {
    fetchUserDetails();
  }, [attemptId]);

  useEffect(() => {
    if (!attemptId) return;
    flushPendingEvents(attemptId);
  }, [attemptId]);

  useEffect(() => {
    const checkAttemptStatus = async () => {
      console.log("checkAttempt");

      try {
        const response = await getAttemptById(attemptId);

        if (response.data.status === "EXPIRED") {
          navigate(`/result/${attemptId}`);
        }

        if (response.data.status === "SUBMITTED") {
          navigate(`/result/${attemptId}`, { replace: true });
        }
      } catch (error) {
        console.error(error);
      }
    };

    checkAttemptStatus();
  }, [attemptId]);

  const fetchUserDetails = async () => {
    try {
      const response = await axios.get(
        `http://localhost:5000/api/attempt/${attemptId}`,
      );
      setAttemptDetails(response.data);
    } catch (error) {
      console.error("Error fetching attempt details:", error);
    }
  };
  console.log(attemptDetails);

  return (
    <div>
      <EventLoggerProvider attemptId={attemptId}>
        {attemptDetails?.attemptId && (
          <TimerComponent
            attemptId={attemptDetails.attemptId}
            duration={location.state?.endTime || 0}
            isSubmitted={isSubmitted}
            onExpire={handleSubmit}
          />
        )}
      </EventLoggerProvider>
      <button disabled={isSubmitted} onClick={() => handleSubmit(attemptId)}>
        submit
      </button>
    </div>
  );
};

export default TestPageComponent;
